import React from 'react';
import ReactDOM from 'react-dom';
import { BiMessageDots } from "react-icons/bi";
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <BiMessageDots></BiMessageDots>
  </React.StrictMode>,
  document.getElementById('root')
);
